const hamburgerToggle = props => (
    <button className="toggle-button">
        <div className="button-line"></div>
        <div className="button-line"></div>
        <div className="button-line"></div>
        <style jsx>{`
        .toggle-button {
            background: red;
            padding: 5rem;        
        }
    `} </style>
    </button>
    
);

export default hamburgerToggle;
